-- ----------------------------
-- Table structure for test_case_run_info
-- ----------------------------
DROP TABLE IF EXISTS `test_case_run_info`;
CREATE TABLE `test_case_run_info`  (
  `id` int(11) NOT NULL AUTO_INCREMENT COMMENT '主键',
  `case_id` int(11) NULL DEFAULT NULL COMMENT 'test_casse id',
  `class_name` varchar(20) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '类名',
  `start_time` datetime(0) NULL DEFAULT NULL COMMENT '开始时间',
  `end_time` datetime(0) NULL DEFAULT NULL COMMENT '结束时间',
  `run_time` int(11) NULL DEFAULT NULL COMMENT '执行时间',
  `run_result` int(11) NULL DEFAULT NULL COMMENT '执行结果：0 失败, 1 成功',
  `img_info` json NULL COMMENT '报错截图文件信息',
  `error_msg` text CHARACTER SET utf8 COLLATE utf8_general_ci NULL COMMENT '错误日志',
  `update_by` varchar(10) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '修改人',
  `method_name` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '方法名称',
  `config_id` int(11) NULL DEFAULT NULL COMMENT '配置id',
  `run_log` text CHARACTER SET utf8 COLLATE utf8_general_ci NULL COMMENT '运行日志',
  PRIMARY KEY (`id`) USING BTREE
) ENGINE = InnoDB AUTO_INCREMENT = 169 CHARACTER SET = utf8 COLLATE = utf8_general_ci ROW_FORMAT = Dynamic;

